//| 3. Bubble Sort                                                   |
//+------------------------------------------------------------------+
UINT64 TestBubbleSort(int array[],int left,int right)
  {
   int    i,j,x;
   UINT64 ticks=GetTickCount64();
//---
   for(i=left+1; i<=right; i++)
      for(j=right;j>=i;j--)
         if(array[j-1]>array[j])
           {
            x=array[j];
            array[j]=array[j-1];
            array[j-1]=x;
           }
//---
   return(GetTickCount64()-ticks);
  }
